,"dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"date":"17-Feb-2022","time":1645117200},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"date":"10-Feb-2022","time":1644512400},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"date":"04-Apr-2022","time":1649091600},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"lesson_note":"Th\\u1ef1c h\\u00e0nh m\\u1ed9t c\\u00e2u h\\u1ecfi thi\\u1ebft k\\u1ebf nghi\\u00ean c\\u1ee9u. Gia B\\u1ea3o ho\\u00e0n th\\u00e0nh \\u0111\\u01b0\\u1ee3c m\\u1ed9t ph\\u1ea7n, nh\\u01b0ng v\\u1eabn m\\u1ea5t kh\\u00e1 nhi\\u1ec1u th\\u1eddi gian. Minh Qu\\u00e2n kh\\u00f4ng n\\u1ed9p b\\u00e0i v\\u1edbi l\\u00fd do m\\u00e1y t\\u00ednh b\\u1ecb m\\u00e0n h\\u00ecnh xanh v\\u00e0 m\\u1ea5t d\\u1eef li\\u1ec7u. Sau \\u0111\\u00f3 m\\u00ecnh ph\\u1ed5 bi\\u1ebfn k\\u1ebf ho\\u1ea1ch \\u00f4n t\\u1eadp v\\u00e0 giao b\\u00e0i t\\u1eadp m\\u1ed7i l\\u1edbp cho c\\u00e1c b\\u00e9.","date":"28-Mar-2022","time":1648486800},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"lesson_note":"Kh\\u00f3 kh\\u0103n khi h\\u1ecdc c\\u1ee7a 2 b\\u00e9 c\\u00f3 th\\u1ec3 chia l\\u00e0m 3 nh\\u00f3m: K\\u1ef9 n\\u0103ng l\\u00e0m b\\u00e0i thi, Ki\\u1ebfn th\\u1ee9c h\\u1ecdc, v\\u00e0 L\\u1ed1i suy ngh\\u0129. Minh Qu\\u00e2n \\u00edt giao ti\\u1ebfp h\\u01a1n, nh\\u01b0ng \\u0111i\\u1ec3m y\\u1ebfu c\\u1ee7a 2 b\\u00e9 t\\u1eadp trung v\\u00e0o ph\\u1ea7n Ki\\u1ebfn th\\u1ee9c v\\u00e0 K\\u1ef9 n\\u0103ng. Gia B\\u1ea3o c\\u00f3 v\\u1ebb \\u0111ang g\\u1eb7p v\\u1ea5n \\u0111\\u1ec1 trong c\\u1ea3 ba. \\u0110\\u1ec3 thay \\u0111\\u1ed5i l\\u1ed1i suy ngh\\u0129 gi\\u00fap c\\u00e1c b\\u00e9 \\u00edt b\\u1ecb g\\u00f2 b\\u00f3 b\\u1edfi l\\u1ed1i h\\u1ecdc c\\u0169, m\\u00ecnh \\u0111\\u00e3 s\\u1eed d\\u1ee5ng nh\\u1eefng v\\u00ed d\\u1ee5 t\\u1eeb c\\u00e1c tr\\u00f2 ch\\u01a1i game \\u0111\\u1ec3 gi\\u00fap c\\u00e1c em nh\\u1eadn ra c\\u00e1ch h\\u1ecdc, nh\\u00ecn nh\\u1eadn, v\\u00e0 ph\\u00e2n t\\u00edch m\\u1ed9t v\\u1ea5n \\u0111\\u1ec1 hay m\\u1ed9t b\\u00e0i nghi\\u00ean c\\u1ee9u. Gia B\\u1ea3o l\\u00fac tr\\u01b0\\u1edbc khi tr\\u1ea3 l\\u1eddi m\\u1ed9t c\\u00e2u h\\u1ecfi \\u00f4n t\\u1eadp, b\\u00e9 c\\u00f3 xu h\\u01b0\\u1edbng lan man nh\\u01b0 khi vi\\u1ebft m\\u1ed9t b\\u00e0i v\\u0103n, th\\u1ebf nh\\u01b0ng c\\u00f3 kh\\u1ea3 n\\u0103ng nh\\u1eadn \\u0111\\u1ecbnh v\\u00e0 ph\\u00e2n t\\u00edch r\\u1ea5t t\\u1ed1t nh\\u1eefng v\\u00ed d\\u1ee5 t\\u1eeb game. M\\u00ecnh \\u0111\\u00e3 ch\\u1ec9 ra cho b\\u00e9 th\\u1ea5y \\u0111\\u01b0\\u1ee3c \\u0111i\\u1ec3m m\\u1ea1nh n\\u00e0y, ch\\u1ec9 ra s\\u1ef1 t\\u01b0\\u01a1ng \\u0111\\u1ed3ng gi\\u1eefa hai tr\\u01b0\\u1eddng h\\u1ee3p, v\\u00e0 th\\u00f4ng qua \\u0111\\u00f3 hy v\\u1ecdng s\\u1ebd thay \\u0111\\u1ed5i \\u0111\\u01b0\\u1ee3c t\\u01b0 duy c\\u1ee7a b\\u00e9. V\\u1ec1 c\\u00e1ch h\\u1ecdc v\\u00e0 \\u00f4n t\\u1eadp chu\\u1ea9n b\\u1ecb cho thi m\\u00ecnh c\\u0169ng \\u0111\\u00e3 n\\u00f3i v\\u1edbi b\\u00e9 nhi\\u1ec1u h\\u01a1n trong bu\\u1ed5i h\\u1ecdp.","date":"14-Mar-2022","time":1647277200},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"lesson_note":"Ph\\u00e2n t\\u00edch trong nghi\\u00ean c\\u1ee9u t\\u00e2m l\\u00fd c\\u00f3 v\\u1ebb l\\u00e0 m\\u1ed9t ch\\u1ee7 \\u0111\\u1ec1 kh\\u00e1 m\\u1edbi l\\u1ea1 v\\u1edbi c\\u00e1c b\\u00e9, v\\u00ec hai b\\u00e9 v\\u1eabn ch\\u01b0a quen v\\u1ec1 kh\\u00e1i ni\\u1ec7m g\\u00f3c nh\\u00ecn, hay \\u0111\\u1eb7t \\u00fd ki\\u1ebfn c\\u1ee7a b\\u1ea3n th\\u00e2n v\\u00e0o c\\u00e2u tr\\u1ea3 l\\u1eddi. H\\u00f4m nay m\\u00ecnh t\\u1eadp trung v\\u00e0o vi\\u1ec7c gi\\u1ea3i th\\u00edch c\\u00e1c g\\u00f3c nh\\u00ecn \\u0111\\u1ec3 ph\\u00e2n t\\u00edch, d\\u1ef1a v\\u00e0o syllabus c\\u1ee7a A Level, c\\u0169ng nh\\u01b0 nh\\u1eefng g\\u00f3c nh\\u00ecn kh\\u00e1c m\\u00e0 c\\u00e1c b\\u00e9 c\\u00f3 th\\u1ec3 ch\\u1ecdn. Khi ch\\u1ecdn xong g\\u00f3c nh\\u00ecn, m\\u00ecnh \\u0111\\u00e3 h\\u01b0\\u1edbng d\\u1eabn c\\u00e1ch ph\\u00e2n t\\u00edch m\\u1ed9t b\\u00e0i nghi\\u00ean c\\u1ee9u \\u0111\\u1ec3 l\\u1ea5y lu\\u1eadn \\u0111i\\u1ec3m, nh\\u1eb1m b\\u1ea3o v\\u1ec7 nh\\u1eadn x\\u00e9t c\\u1ee7a b\\u00e9 v\\u00e0 t\\u1ea1o th\\u00e0nh m\\u1ed9t c\\u00e2u tr\\u1ea3 l\\u1eddi. ","date":"07-Mar-2022","time":1646672400},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"date":"07-Apr-2022","time":1649350800},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"date":"31-Mar-2022","time":1648746000},{"id":"253","id_student":["222","226"],"id_subject":"180","id_prof":"66","starttime":"17:00","endtime":"18:30","dd_prof":1,"dd_student":{"222":1,"226":1},"hours":"1.5","doanh_thu":2100000,"lesson_note":"Minh Qu\\u00e2n kh\\u00f4ng \\u0111i h\\u1ecdc h\\u00f4m nay. Gia B\\u1ea3o \\u0111\\u01b0\\u1ee3c h\\u01b0\\u1edbng d\\u1eabn l\\u1ea1i c\\u00e1ch \\u0111\\u1ecdc v\\u00e0 ph\\u00e2n t\\u00edch m\\u1ed9t b\\u00e0i nghi\\u00ean c\\u1ee9u. Tuy khi h\\u01b0\\u1edbng d\\u1eabn m\\u1ed9t c\\u00e1ch ch\\u1eadm r\\u00e3i th\\u00ec b\\u00e9 c\\u00f3 th\\u1ec3 theo k\\u1ecbp, n